function fetchFindId(email,callback){fetch("https://accounts.bhsjp.kro.kr/id-lookup",{method:"post",headers:{"Content-Type":"application/json"},body:JSON.stringify({email:email})}).then(res=>{return res.text()}).then(text=>{switch(text){case"ok":case"no-row":vex.dialog.alert({unsafeMessage:`입력하신 이메일 주소로 메일이 발송되었습니다<br>확인해주세요`,callback:()=>{location.href="https://accounts.bhsjp.kro.kr/sign-in"}});break;case"error":vex.dialog.alert({unsafeMessage:`서버 에러가 발생했습니다<br>다시 시도해주세요`});break}});callback()}